  \"2016-02-26T22:02:11.621359\",\n\t\"name\": \"dynamic-strain-mapping-and-real-time-damage-state-estimation-under-biaxial-random-fatigue-\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"DYNAMIC STRAIN MAPPING AND REAL-TIME DAMAGE
  STATErnESTIMATION UNDER BIAXIAL RANDOM FATIGUE LOADINGrnrnSUBHASISH MOHANTY*, ADITI
  CHATTOPADHYAY*, JOHN N. RAJADAS**, AND CLYDE COELHO*rnrnAbstract. Fatigue damage
  and its prediction is one of the foremost concerns of structural integrityrnresearch
  community. The current research in structural health monitoring (SHM) is tornprovide
  continuous (or on demand) information about the state of a structure. The SHM systemrncan
  be based on either active or passive sensor measurements. Though the current research
  onrnultrasonic wave propagation based active sensing approach has the potential
  to estimate very smallrndamage, it has severe drawbacks in terms of low sensing
  radius and external power requirements.rnTo alleviate these disadvantages passive
  sensing based SHM techniques can be used. Currently,rnfew efforts have been made
  towards, time-series fatigue damage state estimation over the entirernfatigue life
  (stage-I, II & III). A majority of the available literature on passive sensing SHM
  techniquesrndemonstrates the clear trend in damage growth during the final failure
  regime (stage-IIIrnregime) or during when the damage is comparatively large enough.
  The present paper proposes arnpassive sensing technique that demonstrates a clear
  trend in damage growth almost over the entirernstage-II and III damage growth regime.
  A strain gauge measurement based passive SHM frameworksrnthat can estimate the time-series
  fatigue damage state under random loading is proposed.rnFor this purpose, a Bayesian
  Gaussian process nonlinear dynamic model is developed to map thernreference condition
  dynamic strain at a given instant of time. The predicted strains are comparedrnwith
  the actual sensor measurements to estimate the corresponding error signals. The
  error signalsrnestimated at two different locations are correlated to estimate the
  corresponding fatigue damagernstate. The approach is demonstrated for an Al-2434
  complex cruciform structure applied withrnbiaxial random loading.\",\n\t\"license_title\":
